//adj
int totalnodes = 21615; // 165 x 151 = 24915
int rows = 152; // 165
int columns = 131; // 151
bool[,] adj = new bool[19912, 4]; //24915
int counter = 0;

//adj
foreach (int node in testdfs)
{
    if (node == 0) { for (int i = 0; i < 4; i++) { adj[counter, i] = false; } }
    else if (node == 1)
    {//checkear vecinos
        if (node < rows) { adj[counter, 0] = false; }
        if (counter >= rows && testdfs[counter - rows] == 1)
        {//arriba
            adj[counter, 0] = true;
        }
        else { adj[counter, 0] = false; }

        if ((counter + 1) % rows != 0)
        {
            if (testdfs[counter + 1] == 1)
            {//derecha
                adj[counter, 1] = true;
            }
        }
        else { adj[counter, 1] = false; }

        if (counter < (rows * (columns - 1)) && testdfs[counter + rows] == 1)
        {//abajo
            adj[counter, 2] = true;
        }
        else { adj[counter, 2] = false; }

        if (counter % rows != 0 && testdfs[counter - 1] == 1)
        {//izquierda
            adj[counter, 3] = true;
        }
        else { adj[counter, 3] = false; }
    }
    counter++;
}

//alg
int[] bfs(int start, int end)
{
    int[] solve(int s)
    {
        List<int> queue = new List<int>();
        queue.Add(start);
        bool[] visited = new bool[totalnodes];
        int[] previo = new int[totalnodes];
        for (int i = 0; i < totalnodes; i++)
        {
            visited[i] = false;
            previo[i] = -1;
        }
        void choto()
        {// ARREGLAR ACA, PREGUNTARLE A MOLLO PERRO
            while (queue.Count > 0)
            {
                int current_node = queue[0];
                queue.RemoveAt(0);
                bool[] vecinos = new bool[4]{
                    adj[current_node,0],
                    adj[current_node,1],
                    adj[current_node,2],
                    adj[current_node,3]
                };
                for (int i = 0; i < 4; i++)
                {
                    int next = 0;
                    if (vecinos[i] == true)
                    {
                        if (i == 0) { next = current_node - rows; } //arriba
                        else if (i == 1) { next = current_node + 1; } //derecha
                        else if (i == 2) { next = current_node + rows; } //abajo
                        else { next = current_node - 1; } // izquierda
                    }
                    else { continue; }
                    if (next == end)
                    {
                        previo[next] = current_node;
                        visited[next] = true;
                        break;
                    }
                    else if (next != 0 && visited[next] == false)
                    {
                        previo[next] = current_node;
                        queue.Add(next);
                        visited[next] = true;
                    }
                }
                if (visited[end] == true) { return; }
            }
        }
        choto();
        return previo;
    }
    int[] previo2 = solve(start);
    int[] recopath(int s, int destino, int[] previo)
    {
        //reconstruct path from e to s
        List<int> camino = new List<int>();
        camino.Add(destino);
        for (int i = 0; i < previo.Length; i++)
        {
            camino.Add(previo[camino.Last()]);
            if (camino.Last() == s) { break; }
        }
        camino.Reverse();
        if (camino[0] == s) { return camino.ToArray(); }
        else
        {
            int[] ret = new int[1] { 0 };
            return ret;
        }
    }
    int[] final = recopath(start, end, previo2);
    return final;
    //foreach(int nodo in previo){ Console.WriteLine(nodo); }
    //return previo;
}

